import logo from './logo.svg'; // Esta línea no se usa, puedes eliminarla si no necesitas el logo.
import imagen from './img.png';
import './App.css';

function App() {
  const nombre = "Aiman"; // Usa const para valores que no cambian
  const caja = <div>{nombre}</div>; // Usé {nombre} para interpolar el valor

  return (
    <div className="App">
      <header className="App-header">
        {/* Imagen con atributo alt para accesibilidad */}
        <img src={imagen} alt="Descripción de la imagen" />

        <h1>Curso REACT</h1>

        {/* Renderizamos la variable caja */}
        <div>{caja}</div>
      </header>
    </div>
  );
}

export default App;
